import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { IMAGES } from '../constants/assets';
import '../styles/Navbar.css';

const Navbar = () => {
    const [isOpen, setIsOpen] = useState(false);

    const toggleMenu = () => {
        setIsOpen(!isOpen);
    };

    return (
        <nav className="navbar">
            <div className="navbar-container">
                <Link to="/" className="navbar-logo">
                    <img src={IMAGES.LOGO} alt="Real Estate Logo" />
                </Link>
                <div className={`navbar-menu ${isOpen ? 'active' : ''}`}>
                    <Link to="/" className="navbar-link">Home</Link>
                    <Link to="/properties" className="navbar-link">Properties</Link>
                    <Link to="/buy" className="navbar-link">Buy</Link>
                    <Link to="/sell" className="navbar-link">Sell</Link>
                    <Link to="/rent" className="navbar-link">Rent</Link>
                    <Link to="/login" className="navbar-link">Login</Link>
                    <Link to="/signup" className="navbar-link">Sign Up</Link>
                </div>
                <div className="navbar-burger" onClick={toggleMenu}>
                    <span></span>
                    <span></span>
                    <span></span>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
